function App() {
  const p = document.createElement('p');
  p.textContent = 'this is also visible';
  document.getElementById('root');
  return (
    `<div>
      <h2>Let's get started!</h2>
      <p>This is also visible</p>
      p.textContent
    </div>`
  );
}

export default App;
